(1, 'userAdded', 'Welcome To Truth', '<table align="center" border="0" cellpadding="20" cellspacing="0" style="width:100%">\n	<tbody>\n		<tr>\n			<td style="width:100%">\n			<table align="center" border="0" cellpadding="0" cellspacing="0" style="width:650px">\n				<tbody>\n					<tr>\n						<td style="width:100%">\n						<table style="width:100%">\n							<tbody>\n								<tr>\n									<td style="width:50%"><img alt="{site}" src="{site_link}/dist/img/zestora.png" style="width:90px" /></td>\n								</tr>\n							</tbody>\n						</table>\n\n						<table align="left" border="1" cellpadding="25" style="width:100%">\n							<tbody>\n								<tr>\n									<td style="vertical-align:top; width:100%">\n									<h1>Hi {name},</h1>\n\n									<p>Thank you for joining us and welcome to {site} !</p>\n\n									<p>&nbsp;</p>\n\n									<p>You can now manage your personal details and preferences on the settings page after logging in <a href="{site}" target="_blank"> {site} </a>.</p>\n									&nbsp;\n\n									<p>You can login to your account using the following credentials:</p>\n									&nbsp;\n\n									<p><strong>Email:&nbsp;</strong>{email}</p>\n									&nbsp;\n\n									<p><strong>Password:&nbsp;</strong>{password}</p>\n									&nbsp;\n\n									<p>&nbsp;</p>\n\n									<p>{site} team wishes you a lot of fun on our platform!</p>\n									&nbsp;\n\n									<p><br />\n									Cheers,<br />\n									Team {site}</p>\n									</td>\n								</tr>\n							</tbody>\n						</table>\n\n						<table style="width:100%">\n							<tbody>\n								<tr>\n									<td style="width:100%">\n									<p align="center"><img alt="{site}" src="{site_link}/dist/img/zestora.png" style="width:32px" /></p>\n\n									<p>This email was sent to <a href="mailto:{email}" target="_blank"> {email} </a>.<br />\n									{site} will not send you any annoying marketing offers or general updates. We just keep this email address to communicate in case you have questions or issues with the account like resetting password. And at any point you can request us to delete your contact details. For all this, just email us at <a href="mailto:{help_email}" target="_blank"> {help_email}</a>, or reach us directly through the app.</p>\n									</td>\n								</tr>\n							</tbody>\n						</table>\n						</td>\n					</tr>\n				</tbody>\n			</table>\n			</td>\n		</tr>\n	</tbody>\n</table>', '{name},{email},{link},{site},{site_link},{slogan},{info_email},{help_email},{office_address},{password}', NULL, '2018-11-15 07:43:24'),
(2, 'supportReply', 'Contact Us Reply From Truth', '<div style="margin:0;padding:0;width:100%;font-weight:500;font-size:16px;line-height:26px;background:none #fafafa;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\n<table align="center" border="0" cellpadding="20" cellspacing="0" style="color:#73706d;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:100%;margin:0;padding:0;line-height:100%;background:none #fafafa">\n	<tbody>\n		<tr style="color:#73706d;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\n			<td style="color:#73706d;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;width:100%">\n			<table align="center" border="0" cellpadding="0" cellspacing="0" style="color:#73706d;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:650px">\n				<tbody>\n					<tr style="color:#73706d;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\n						<td style="color:#73706d;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;width:100%">\n						<table style="color:#73706d;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:100%">\n							<tbody>\n								<tr style="color:#73706d;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\n									<td align="left" height="45" style="width:50%;color:#73706d;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;padding:0 0 15px"><a style="color:#195090;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none" target="_blank"> <img alt="{site}" src="{site_link}/dist/img/logo.png" style="color:#73706d;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;outline:none;text-decoration:none;max-width:100%;border:none" width="100" /> </a></td>\n							\n								</tr>\n							</tbody>\n						</table>\n\n						<table align="left" cellpadding="25" style="color:#73706d;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:100%;background:none #fff;border-radius:2px;border:solid 1px #eee">\n							<tbody>\n								<tr style="color:#73706d;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\n									<td style="color:#73706d;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;width:100%;vertical-align:top">\n									<h1 style="color:#195090;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;font-weight:300;line-height:1.1;margin:0 0 20px">Hi {name},</h1>\n\n									<p style="color:#19121291;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:16px;line-height:160%;font-weight:400;padding:0 0 32px;padding-bottom:0px">Thank you for showing your interest in {site} !</p>\n\n									\n									&nbsp;\n\n									<p style="text-align:left;color:#19121291;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:16px;line-height:160%;font-weight:400;padding:0 0 32px;padding-bottom:0px">{question}</p>\n									&nbsp;\n\n									<p style="text-align:left;color:#19121291;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:16px;line-height:160%;font-weight:400;padding:0 0 32px;padding-bottom:0px"><strong>Reply:&nbsp;</strong>{message}</p>\n									&nbsp;\n\n									<p style="color:#19121291;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:16px;line-height:160%;font-weight:400;padding:0 0 32px;padding-bottom:0px">&nbsp;</p>\n\n									<p style="color:#19121291;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:16px;line-height:160%;font-weight:400;padding:0 0 32px;padding-bottom:0px">{site} team wishes you a lot of fun on our platform!</p>\n									&nbsp;\n\n									<p style="color:#19121291;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:16px;line-height:160%;font-weight:400;padding:0 0 32px;padding-bottom:20px"><br />\n									Cheers,<br />\n									Team {site}</p>\n									</td>\n								</tr>\n							</tbody>\n						</table>\n\n						<table style="color:#73706d;font-family:Helvetica Neue,Helveti